import React from 'react'
import { Link } from 'react-router-dom'
import { slide as Menu } from 'react-burger-menu'


class Header extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      sidebarOpen: true
    };
    this.onSetSidebarOpen = this.onSetSidebarOpen.bind(this);
  }

  showSettings (event) {
    event.preventDefault();
  }

  render() {
    return (
      <Menu>
        <Link to="home" className="menu-item" href="/">Home</Link>
        <Link to="entity designer" className="menu-item" href="/EntityDesigner">entity designer</Link>
        <Link to="form designer" className="menu-item" href="/FormDesigner">form designer</Link>
        <Link to="workflow designer" className="menu-item" href="/WorkflowDesigner">workflow designer</Link>

      </Menu>
    );
  }
}

export default Header
